import React, { Component } from "react";

class lawAdd extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <h1>Hello JONES</h1>
        <input type="text" name="firstName"></input>
        <input type="text" name="lastName"></input>
        <input type="text" name="barGrading"></input>
      </div>
    );
  }
}

export default lawAdd;
